import React from "react";

//material-ui
import Grid from "@material-ui/core/Grid";
import Container from "@material-ui/core/Container";

export const Main = () => {
  return (
    <div className="main">
      <React.Fragment>
        <Container
          justify='center'
          maxWidth="md"
          style={{ backgroundColor: "lightgrey", height: "100vh" }}
        >
          <Grid container >
            <Grid
              item
              style={{ height: "50vh", padding:'10px' , backgroundColor: "red" }}
              md={6}
            >
              <div style={{ width:'100%' , height:'100%' , backgrounColor:'rgba( 0 , 0 , 34 , 1 )' }} className="container">
                <h1>Hello world!</h1>
              </div>
            </Grid>
            <Grid
              item
              style={{ height: "50vh", padding:'10px' , backgroundColor: "green" }}
              md={6}
            >
              <div style={{ width:'100%' , height:'100%' , backgrounColor:'rgba( 0 , 0 , 34 , 1 )' }} className="container">
                <h1>Hello world!</h1>
              </div>
            </Grid>
          </Grid>
          <Grid container >
            <Grid
              item
              style={{ height: "50vh", padding:'10px' , backgroundColor: "grey" }}
              md={6}
            >
              <div style={{ width:'100%' , height:'100%' , backgrounColor:'rgba( 0 , 0 , 34 , 1 )' }} className="container">
                <h1>Hello world!</h1>
              </div>
            </Grid>
            <Grid
              item
              style={{ height: "50vh", padding:'10px' , backgroundColor: "blue" }}
              md={6}
            >
              <div style={{ width:'100%' , height:'100%' , backgrounColor:'rgba( 0 , 0 , 34 , 1 )' }} className="container">
                <h1>Hello world!</h1>
              </div>
            </Grid>
          </Grid>
        </Container>
      </React.Fragment>
    </div>
  );
};
